export default class CardData {



    constructor() {
        this.arrayOfMaps = [];
    }

    pushToArray(question, answer) {
        let m = new Map();
        m.set("id", this.arrayOfMaps.length())
        m.set("question", question);
        m.set("answer", answer);
        this.myArray.push(m)
    }
